import { Component, Output, EventEmitter } from '@angular/core';
import { CommonModule } from '@angular/common';
import { FormsModule } from '@angular/forms';
import { RouterModule } from '@angular/router';
import { LanguageService } from '../../services/language.service';

@Component({
  selector: 'app-login',
  template: `
    <div class="flex items-center justify-center min-h-screen bg-gray-50 dark:bg-gray-900">
      <div class="relative w-full max-w-md p-8 space-y-8 bg-white rounded-lg shadow-lg dark:bg-gray-800">
        <button (click)="close()" class="absolute top-4 right-4 text-gray-400 hover:text-gray-700 dark:hover:text-white text-2xl focus:outline-none" aria-label="Cerrar">
          &times;
        </button>
        <h2 class="mt-2 text-3xl font-extrabold text-center" [style.color]="'#215A3D'">
          {{ translations[currentLanguage].title }}
        </h2>
        <div>
          <p class="mt-2 text-center text-sm text-[#7CB518]">
            {{ translations[currentLanguage].subtitle }}
          </p>
        </div>
        <form class="mt-8 space-y-6" (ngSubmit)="onSubmit()">
          <div class="rounded-md shadow-sm -space-y-px">
            <div>
              <label for="email-address" class="sr-only">{{ translations[currentLanguage].emailLabel }}</label>
              <input id="email-address" name="email" type="email" autocomplete="email" required
                [(ngModel)]="email"
                class="appearance-none rounded-none relative block w-full px-3 py-2 border border-gray-300 dark:border-gray-700 placeholder-gray-500 dark:placeholder-gray-400 text-gray-900 dark:text-white rounded-t-md focus:outline-none focus:ring-[#7CB518] focus:border-[#7CB518] focus:z-10 sm:text-sm dark:bg-gray-800"
                [placeholder]="translations[currentLanguage].emailPlaceholder">
            </div>
            <div>
              <label for="password" class="sr-only">{{ translations[currentLanguage].passwordLabel }}</label>
              <input id="password" name="password" type="password" autocomplete="current-password" required
                [(ngModel)]="password"
                class="appearance-none rounded-none relative block w-full px-3 py-2 border border-gray-300 dark:border-gray-700 placeholder-gray-500 dark:placeholder-gray-400 text-gray-900 dark:text-white rounded-b-md focus:outline-none focus:ring-[#7CB518] focus:border-[#7CB518] focus:z-10 sm:text-sm dark:bg-gray-800"
                [placeholder]="translations[currentLanguage].passwordPlaceholder">
            </div>
          </div>

          <div class="flex items-center justify-between">
            <div class="flex items-center">
              <input id="remember-me" name="remember-me" type="checkbox"
                [(ngModel)]="rememberMe"
                class="h-4 w-4 text-[#7CB518] focus:ring-[#7CB518] border-gray-300 dark:border-gray-700 rounded">
              <label for="remember-me" class="ml-2 block text-sm text-gray-900 dark:text-gray-300">
                {{ translations[currentLanguage].rememberMe }}
              </label>
            </div>

            <div class="text-sm">
              <a href="#" class="font-medium text-[#7CB518] hover:text-[#6a9e15]">
                {{ translations[currentLanguage].forgotPassword }}
              </a>
            </div>
          </div>

          <div>
            <button type="submit"
              class="group relative w-full flex justify-center py-2 px-4 border border-transparent text-sm font-medium rounded-md text-white bg-[#215A3D] hover:bg-[#1a4730] focus:outline-none focus:ring-2 focus:ring-offset-2 focus:ring-[#7CB518]">
              {{ translations[currentLanguage].signIn }}
            </button>
          </div>
        </form>
      </div>
    </div>
  `,
  styles: [`
    :host {
      display: block;
    }
  `],
  standalone: true,
  imports: [CommonModule, FormsModule, RouterModule]
})
export class LoginComponent {
  currentLanguage = 'es';
  email: string = '';
  password: string = '';
  rememberMe: boolean = false;

  @Output() closeModal = new EventEmitter<void>();

  translations: { [key: string]: { title: string; subtitle: string; emailLabel: string; emailPlaceholder: string; passwordLabel: string; passwordPlaceholder: string; rememberMe: string; forgotPassword: string; signIn: string } } = {
    es: {
      title: 'Iniciar Sesión',
      subtitle: 'Ingresa tus credenciales para continuar',
      emailLabel: 'Correo electrónico',
      emailPlaceholder: 'Correo electrónico',
      passwordLabel: 'Contraseña',
      passwordPlaceholder: 'Contraseña',
      rememberMe: 'Recordarme',
      forgotPassword: '¿Olvidaste tu contraseña?',
      signIn: 'Iniciar Sesión'
    },
    en: {
      title: 'Sign In',
      subtitle: 'Enter your credentials to continue',
      emailLabel: 'Email address',
      emailPlaceholder: 'Email address',
      passwordLabel: 'Password',
      passwordPlaceholder: 'Password',
      rememberMe: 'Remember me',
      forgotPassword: 'Forgot your password?',
      signIn: 'Sign In'
    }
  };

  constructor(private languageService: LanguageService) {
    this.languageService.currentLanguage$.subscribe((lang: string) => {
      this.currentLanguage = lang;
    });
  }

  onSubmit() {
    console.log('Form submitted', {
      email: this.email,
      password: this.password,
      rememberMe: this.rememberMe
    });
  }

  close() {
    this.closeModal.emit();
  }
}
